import React from "react";
import "./footer.css";
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";
import { Link } from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick_links = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "tours",
    display: "Tours",
  },
];

const quick_links2 = [
  {
    path: "/galerry",
    display: "Galerry",
  },
  {
    path: "/login",
    display: "Login",
  },
  {
    path: "register",
    display: "Register",
  },
];
const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="3">
            <div className="logo">
              <img src={logo} alt="" />
              <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Neque, laboriosam.</p>
            </div>

            <div className="social_links d-flex align-items-center gap-4">
                <span>
                    <Link to='#'><i class="ri-youtube-line"></i></Link>
                </span>
                <span>
                    <Link to='#'><i class="ri-github-line"></i></Link>
                </span>
                <span>
                    <Link to='#'><i class="ri-instagram-line"></i></Link>
                </span>
                <span>
                    <Link to='#'><i class="ri-facebook-circle-fill"></i></Link>
                </span>
            </div>
          </Col>
          <Col lg='3'>
          <h5 className="footer_link-title">Discover</h5>
          <ListGroup className="footer_quick-link"></ListGroup>
          </Col>
          <Col lg='3'></Col>
          <Col lg='3'></Col>
          <Col lg='3'></Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
